import React, { useContext } from 'react';
import { Ans, ColDivId } from './Home';

const FaqAns = () => {
    const Answer = useContext(Ans);
    const DivId = useContext(ColDivId);
    return (<>
        <div className="collapse" id={DivId}>
            <p className="pl-3">{Answer}</p>
        </div>
    </>)
}

export default FaqAns;
